  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains the total number
  of enacted direct positions for the years 2011 to 2015. The totals are categorized
  by program area, location, grade series, and functional area. Note: The number of
  enacted positions differs from the total number of employees. Direct positions equate
  to the number of billets funded, while employees represent the total number of personnel
  onboard at a given point in time.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
